import React, { memo } from 'react';
import styled from 'styled-components';

const BasketContainer = styled.div`
    width: 60%;
    height: 260px;
    background-color: #c0c0c0;
    border-radius: 5px;
    margin:20px 10px;
`;
const ItemBasket = memo(() => {
    return (
        <BasketContainer>
            <h3>남은시간</h3>
            <p>100초</p>
        </BasketContainer>
    );
});

export default ItemBasket;
